import com.eviware.soapui.support.XmlHolder
def response = context.testCase.getTestStepByName("CreateProduct").getPropertyValue("response")
def holder = new XmlHolder(response)
def name = holder.getNodeValue("//*:name")
context.testCase.setPropertyValue("name",name)
def price = holder.getNodeValue("//*:price")
context.testCase.setPropertyValue("Price",price)

log.info name
log.info price

import com.eviware.soapui.support.XmlHolder
def response = context.testCase.getTestStepByName("GetProductById").getPropertyValue("response")
def holder = new XmlHolder(response)
def actualname = holder.getNodeValue("//*:name")
//context.testCase.setPropertyValue("name",name)
def actualprice = holder.getNodeValue("//*:price")
//context.testCase.setPropertyValue("Price",price)
def expectedName=context.expand('${#TestCase#name}')
def expectedPrice=context.expand('${#TestCase#price}')
log.info expectedName
log.info expectedPrice

if(actualname==expectedName && actualprice==expectedPrice)
{
	log.info "Product is verified"
	return "Product is verified"

}
else
{
	lof.info "Invalid product is returned"
	return "Invalid product"

}

