import jxl.*
def SKUid,Name,Price
def filepath="C:/Abinaya backup/Abinaya/Manipal Team course/API Testing/CatalogProduct.xls"
File Excel = new File(filepath)
Workbook wb = Workbook.getWorkbook(Excel)
Sheet sh = wb.getSheet("Sheet1")
def rowSize = sh.getRows().toInteger()
def colSize= sh.getColumns().toInteger()

log.info " $rowSize and $colSize"

for(def i=1;i<rowSize;i++)
{
    for(def j=0;j<colSize;j++)
    {
            SKUid=sh.getCell(0,1).getContents()
            log.info "$SKUid"
            Name=sh.getCell(1,1).getContents()
            log.info "$Name"
            Price=sh.getCell(2,1).getContents()
            log.info "$Price"

    }
}

import com.eviware.soapui.model.testsuite.TestRunner.Status

 def tc = testRunner.testCase.testSuite.project.testSuites["Functional test"].testCases["Testing Using Property Expansion & groovy script"]

tc.testSteps["SKUId"].setPropertyValue("SKUId",SKUid)
tc.testSteps["SKUId"].setPropertyValue("Product Name", Name)
tc.testSteps["SKUId"].setPropertyValue("Price",Price)

  def runner = tc.run( null, false )

 //show the test case result status
log.info "Status: $runner.status, time taken for TestCase was: $runner.timeTaken ms"
log.info "Number of test steps which ran: " + runner.results.size()

// assert that it didn't fail
assert runner.status != Status.FAILED : runner.reason

// assert that only four steps ran!!
assert runner.results.size() == 5

import com.eviware.soapui.model.testsuite.TestRunner.Status
def sku,i,name,price
def res=context.testCase.getTestStepByName("Database Connection").getPropertyValue("responseAsXML")
log.info res
def count=context.expand('${Database Connection#ResponseAsXML#count(//ResultSet/Row/PRODUCT.SKU)}').toInteger()
log.info count

for(i=1;i<=count;i++)
{
	sku=context.expand('${Database Connection#ResponseAsXML#//ResultSet/Row['+i+']/PRODUCT.SKU}')
	log.info sku
	name=context.expand('${Database Connection#ResponseAsXML#//ResultSet/Row['+i+']/PRODUCT.NAME}')
	log.info name
	price=context.expand('${Database Connection#ResponseAsXML#//ResultSet/Row['+i+']/PRODUCT.PRICE}')
	log.info price


def tc = testRunner.testCase.testSuite.project.testSuites["Functional test"].testCases["Testing Using Property Expansion & groovy script"]

tc.testSteps["SKUId"].setPropertyValue("SKUId",sku)
tc.testSteps["SKUId"].setPropertyValue("Product name",name)
tc.testSteps["SKUId"].setPropertyValue("Price",price)

  def runner = tc.run( null, false )

 //show the test case result status
log.info "Status: $runner.status, time taken for TestCase was: $runner.timeTaken ms"
log.info "Number of test steps which ran: " + runner.results.size()

// assert that it didn't fail
